import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path: '',
    redirectTo: '/controladora/morador/entrada',
    pathMatch: 'full',
  },
  {
    path:'',
    children: [
      {
        path:'morador',
        loadComponent: ()=> import('./acoes-visitante/acoes-visitante.component')
      },
      {
        path:'visitante',
        loadComponent: ()=> import('.')
      },
      {
        path:'veiculo',
        loadComponent: ()=> import('.')
      },
      {
        path:'funcionario',
        loadChildren: ()=> import('./funcionario/funcionario.module').then((module)=> module.FuncionarioModule)
      }
    ]
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class VisitaRoutingModule { }
